import React from "react";
import CardList from "./CardList";
import { robots } from "./robots";

const App = () => {
  return (
    <div className="tc">
      <h1>Robo Friends</h1>;
      <Searchbox />;
      <CardList robots={robots} />;
    </div>
  );
};

export default App;
